interface Props{
    visible: boolean;
}

export default function NextBtn(props: Props){
    const { visible } = props
    return(
        <>
            {visible && 
            <div className="cursor-pointer p-2 bg-blue-500 text-white rounded-md text-center m-3">
                Next
            </div> 
            }
        </>
    )
}
